
SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

CREATE TABLE `historietas` (
  `id_his` int(11) NOT NULL,
  `edit_his` varchar(15) NOT NULL,
  `pers_his` varchar(15) NOT NULL,
  `gen_his` varchar(15) NOT NULL,
  `auto_his` varchar(15) NOT NULL,
  `anio_his` varchar(4) NOT NULL,
  `pais_his` varchar(15) NOT NULL,
  `Imagen` blob NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




ALTER TABLE `historietas`
  ADD PRIMARY KEY (`id_his`);

ALTER TABLE `historietas`
  MODIFY `id_his` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=11;
